#!/usr/bin/env python3# -*- coding: utf-8 -*-"""Created on Tue Aug 20 13:47:51 2024@author: chenleyu"""class Solution(object):    def removeDuplicates(self, nums):        """        :type nums: List[int]        :rtype: int        """        val_to_comp = nums[0]        ret=1        for idx in range(0, len(nums) - 1, 1):            if(val_to_comp == nums[idx+1]):                nums[idx+1] = 101                continue            else:                ret += 1                val_to_comp = nums[idx+1]            # print(nums)        nums.sort()        # print(nums)        return ret        s=Solution()val = s.removeDuplicates([1,1,2])print(val)